import Ninjas from "./Ninjas";
import "./App.css";
import React, { Component } from 'react';

class App extends Component {
  state={
  lninjas:[
    {name:'viktor',age:'22',belt:"black",},
    {name:'jessica',age:'20',belt:"blue"},
    {name:'silas',age:'23',belt:"green"},
  ]
  }

  render() {
    return (
      <div className="App">
        <h1>this is good</h1>
        <Ninjas />
      </div>
    );
  }

}

export default App;
